import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="login-body">
      <div className="login-container">
        <form></form>
        <label htmlFor ="username">Username</label>
        <input type ="textbox" id ="username" name ="name"></input>
        <label htmlFor ="username">Password</label>
        <input type ="textbox" id ="username" name ="name"></input>
      </div>
    </div>
  );
}

export default App;
